]
,[1,"\n"]
,[0,"I am not a person to write reviews, but I felt compelled to share my story of a horrible experience at Summit. My son was enrolled in the 3rd grade reading and writing summer program which advertised to \"engage students' interests...and to develop an appreciation for literature.\" Instead of engaging my child, they worked on printed out worksheets in class as well as at home for homework. As an educator in elementary school, I found the curriculum to lack engaging effort. Any person could have easily had their child read chapters of a book and work on worksheets at home.",[0,0,0,0]
]
,[1,"\n"]
,[1,"\n"]
,[0,"I understand that some children can learn from this type of rote learning, but my child was feeling lost and overwhelmed with no help from the instructor during class. My child also did not develop an appreciation for literature from this class. Instead, the class created a dislike to reading and writing - something I had hoped would not happen from a summer program. ",[0,0,0,0]
]
,[1,"\n"]
,[1,"\n"]
,[0,"I had to repetitively call the office to get clarification on an assignment and to address my issues with this class, but never got any calls back. I had to proactively call until I was finally put on the line with Maggie who argued with me the whole time. Not only was the class not \"engaging,\" but Maggie was extremely unprofessional and difficult to communicate with. I quickly stopped sending my child to his classes and he has been reading and writing at home with me and progressing so much more than at Summit....and he's actually enjoying our creative writing projects at home! I wasted money, but that seems so trivial compared to the time that was wasted making my child sit through hours of classes.",[0,0,0,0]
]
]
